site.headStyle:
body .editable-style.column-section.container-element {
    padding: 0;
    margin: 0;
}
/* section takes all width */
div.column-section {
  width: 100%;
}
div.column-section > a {
  width: 100%;
}
@media (min-width:481px) {
  .silex-editor div.column-section {
    /* leave space to drop, only in the editor */
    padding: 50px 0;
  }
  .image-overlay-container1{
   background-color: black;
   opacity: 1;
   transition: opacity .3s ease;
  }
  .image-overlay-container1:hover{
      background-color: black;
    opacity: 0.8;
  }

  div.column-section > a {
    /* 3 elements per line */
    width: 33.333%;
  }
}
.Heading_4 {
    font-family: 'Glegoo';
    font-weight: bold;
    font-style: normal;
    font-size: 16px;
    text-decoration: none;
    color: #008001;
    background-color: Transparent;
    letter-spacing: 0em;
}
